script: |
  super -f text -I q13.spq | sort > q13.out

inputs:
  - name: q13.spq
    data: |
      SELECT DISTINCT + col1 * col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col2 / + 46 + - - col2 + col0 + ( col1 ) - 56 BETWEEN + col1 + + ( 91 + col1 * - col0 ) * + col1 AND ( col1 );
  - name: tab2

outputs:
  - name: q13.out
    data: |
      2601
      4489
      5929
